import React from "react";
import "../styles.css";

const Main = () => {
    return (
        <section id="Main" className="main">
            <div className="main-overlay"></div>
            <div className="main-content">
                <h1 className="main-title">AGABAIII</h1>
                <p className="main-subtitle">Снимая мгновенья своей жизни, находя красоту и историю в каждом кадре.</p>
            </div>
        </section>
    );
};

export default Main;
